import React from "react";
import styled from "styled-components";
import brandLogo from "../img/EverySports.png";

const Container = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
`;

const Contents = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  border: 1px solid red;
  width: 1325px;
  @media screen and (min-width: 768px) and (max-width: 991px) {
    width: 700px;
  }

  @media screen and (max-width: 767px) {
    width: 300px;
  }
`;
const BrandLogo = styled.img`
  display: flex;
  width: 18rem;
  height: 18rem;
  margin-right: 3rem;
  transition: 0.3s ease-in;
  @media screen and (max-width: 767px) {
    display: none;
  }
`;
const BrandDescContainer = styled.div`
  display: block;
  width: 500px;
  h1 {
    margin-top: 0;
    color: #20c997;
  }
  p {
    color: #868e96;
    font-weight: bold;
  }
`;

const Second = () => {
  return (
    <Container>
      <Contents>
        <BrandLogo src={brandLogo} />
        <BrandDescContainer>
          <h1>EverySports</h1>
          <p>
            I don't wanna be left behind Distance was a friend of mine Catching
            breath in a web of lies I've spent most of my life Riding waves,
            playing acrobat Shadowboxing the other half Learning how to react
            I've spent most of my time Catching my breath, letting it go Turning
            my cheek for the sake of this show Now that you know, this is my
            life I won't be told what's supposed to be right
          </p>
        </BrandDescContainer>
      </Contents>
    </Container>
  );
};

export default Second;
